import * as Types from "../actions/types";

const init = {
  isAuthenticated: false,
  student: {},
  error: {},
  hola_success: "",
  success: ""
};

const stdReducer = (state = [], action) => {
  switch (action.type) {
 
    case Types.STUDENT_LIST:{
      return (action.payload.student_list)
    }
    default:
      return state;
  }
};

export default stdReducer;
